import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super()
    this.state = {
     monsters: [ ],
  };

  }
  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users').then(response => console.log(response));
  }
  render() {
    return (
      <div className="App">
        { this.state.monsters.map((input) => {
          return <h1>{input.name}</h1>
        })}
      </div>
    );
  }
}

export default App;
